INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Captain William West arrived at Jamestown in June 1610 as part of a military force commanded by his kinsman Thomas West, Lord De La Warr, the first captain general and governor of the colony. Several months later, De La Warr ordered some of his men to the falls of the James Rivernear present day Richmondto repossess a fort (Lawares Fort) abandoned by the English the year before. The fort was located in the heartland of the Powhatan chiefdom and fierce fighting between the English soldiers and elite Indian warriors took place there. The governor was present at the fort as winter set in when William West was killed in fighting. His kinship to Lord De La Warr was likely the reason he was brought back to Jamestown for burial.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200003'; 
