INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$At the time of discovery, the silver-copper alloy box burried with Captain Gabriel Archer was covered by a green layer of corrosion formed by reaction of the metals with the surrounding soil. Many hours of careful cleaning in a dry, stable environment removed the corrosion to reveal the well-preserved outer surface. Senior conservator, Michael Lavin, with the Jamestown Rediscovery archaeological project, conserves the exterior of a sealed silver box found in an early 17th-century grave in Jamestown, Virginia. He spent over 100 hours conserving the piece, which is a religious reliquary.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200004'; 
