INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Non-destructive Micro CT imaging revealed seven bone fragments alongside the lead ampulla within the silver box. Forensic anthropologists at the National Museum of Natural History have studied the virtual data and feel that the bone fragments are most likely human. This is further evidence that the silver box is a reliquary.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200005'; 
