INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The soil in a burial shaft differs in color and composition from the surrounding undisturbed matrix because digging and re-filling a grave mixes soil layers. Excavations in the east end of the 1608 church revealed dark areas of soil showing four graves located within the chancel, a space commonly occupied by clergy, government officials, and the altar table. In the 17th century, burial in the chancel was reserved for high-status individuals. The four graves (below left) were originally dug between January of 1608 and 1617 when the church fell into disrepair. The space occupied by the chancel measured approximately 24 by 12.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200006'; 
