INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Cooper Hewitt, Smithsonian Design Museum is housed in the former home of industrial magnate Andrew Carnegie. The 64-room mansion, built from 1899 to 1902, is an impressive testament to the desire of Carnegie and his wife, Louise Whitfield Carnegie, to build a spacious, comfortable, and light-filled home in which to raise their daughter, Margaret. The architectural firm of Babb, Cook & Willard designed the mansion in the solidly comfortable style of an English Georgian country house. When Carnegie purchased the land for the house in 1898, he purposely bought property far north of where his peers were living. The relatively open space allowed him to build a large gardenone of the few private enclosed green spaces in Manhattanthat is still a beautiful oasis today.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200011'; 
