INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$This result shows Cassiopeia A (Cas A) coming alive through the third dimension of space. Utilizing a technique borrowed from medical imaging, astronomers now have a way to travel through the heart of Cas A using data from NASA''s Chandra and Spitzer telescopes. The different colors shown here correspond to different elements in the debris from the supernova explosion. This ground-breaking visualization of Cas A was made possible through a collaboration with the Astronomical Medicine project based at Harvard.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200012'; 
