INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Liang Bua is a magnificent limestone cave on the Indonesian island of Flores. The fossil species Homo floresiensisthe so-called ''hobbits'' of human evolutionwas first discovered here in 2003. Hundreds of scientific articles and news stories about Homo floresiensis have been published since this seriously amazing discovery. Since 2010, excavations at Liang Bua have continued as a collaboration between researchers from the National Center for Archaeology in Indonesia, the Smithsonian''s Human Origins Program, and the Centre for Archaeological Science at the University of Wollongong in Australia. This team of researchers scanned the entire cave in order to help answer their research questions while also enabling people to experience this wonderful place in 3D. 3D scans of Liang Bua are helping researchers better understand its prehistory while also providing the public to virtually visit this world-renowned archaeological site.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200014'; 
