INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$In the city of Cusco, Peru, capital of the Inka Empire, we find this Inka wall, now one side of Hatunrumiyoc Street, was originally part of the palace of Inka Roca. The large stone of green diorite in the center is the famous twelve-angled stone.   ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200028'; 
