INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The Inka Pachacutic ordered the construction of royal estates in Pisac, Ollantaytambo, Machu Picchu, and other locations. The building in Pisac was built on the hill that dominated the Sacred Valley in order to control the area from the southwest. It has four districtsPisaqa, Qallaqasa, Kinchirajay, and Intihuatana. Intihuatana was dedicated to the cult of the sun.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200029'; 
