INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The sacred city of Cusco was laid out in the shape of a puma, and Saqsaywaman (sak sigh WAH mahn) was its head. Saqsaywaman was the symbol of the military and religious power of the state. Saqsaywaman occupied the head of Cuscos puma shape. Dedicated to Inti, the sun, this temple stood in hanan(upper) Cusco as the counterpart to the Qorikancha, the temple in hurin(lower) Cusco.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200032'; 
