INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The Inka did not use mortar. They did not have iron tools, the wheel, or draft animals. Their stonework, however, is so precise that a piece of paper cannot be slipped between the individual stones. These stones are renowned for their precision, beauty, and pillow shape, as well as their resistance to earthquakes.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200034'; 
