INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$STS 5, a nearly complete adult Australopithecus africanus, was an important fossil find because skeptics had previously argued that the Taung Child was actually a baby chimpanzee that would have gained its ape-like features when it got older. This fossil showed that maturity wouldnt make A. africanus less human. The main difference between STS 5 and the Taung Child is that this fossil''s face is strongly prognathic, an ape-like feature that becomes more pronounced as A. africanus individuals grow up.  ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200041'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$STS 5 was nicknamed ''Mrs. Ples'' by scientist Robert Broom after initially hypothesizing that she was a middle-aged female Plesianthropus transvaalensis, which was the original name of this species---thus, Mrs. Ples. This skull now thought to have belonged to a male.    ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200041'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Often found alongside animal bones, Australopithecus africanus was once considered a killer ape. Now we know that members of this early human species were sometimes eaten by predators. Living together in groups helped these early humans protect themselves.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200041'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Why dynamite is not necessarily the best way to excavate human remains.... do you see the wedge-shaped portion of the forehead reconstructed here in a light color? If you follow that crack around to the rear of the skull, youll see why scientists are much more careful today when excavating, or digging for human remains. Mrs. Ples skull was actually blown into two pieces during its extraction from the breccia (a cement-like rock) because Broom used dynamite to expose the remains over backbreaking work with a pickaxe.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200041'; 
