INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$When this 3-year-old child''s skull was found in 1924, it was among the first early human fossils to be found in Africa -- and the first early human fossil discovery to draw major attention to this region as a place of origin of the human family tree. Still, it took over 20 years after that before scientists accepted the importance of Africa as a major source of human evolution.  ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200043'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The Taung Childs fossilized anatomy represented the first time researchers saw evidence of early human upright, two-legged  (bipedal) walking. The evidence was the position of the Taung Childs foramen magnum, or the hole through which the spinal cord connects with the brain. This spinal cord hole is positioned toward the front of the Taung Childs skull, a characteristic associated with bipedal locomotion. This bipedal adaptation allows the head to balance atop of the neck; while contrastingly, a four-legged ape has its foramen magnum positioned toward the rear of the head to keep its eyes facing forward (and not down) when it moves.  ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200043'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The Taung Childs first molars had only just begun to erupt through the gum and become visible as teeth, indicating that the fossilized jaw belongs to a child. Closer analysis of dental development, crown formation, and root length has estimated the childs age at death at 3.3 years.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200043'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The Taung Child is thought have been attacked and killed by an eagle. Scientists suspect an eagle killed the Taung Child because puncture marks were found at the bottom of the 3-year-olds eye sockets (see close-up photo below). These marks resemble those made by a modern eagles sharp talons and beak when they attack monkeys in Africa today. Other evidence for the eagle kill hypothesis includes the presence of eggshells at the site and an unusual mixture of animals bones found alongside the Taung Childs skull. Most of the bones found are from small animals (including hyrax, rodents, tortoises, lizards, crabs, small antelopes, and small baboons), which is uncommon compared with animal bones at other early human sites. Many of these small animal bones also have damage resembling that made by modern birds of prey.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200043'; 
