INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$For the first several million years of human evolution, early humans lived only in Africa. By about 1.8 million years ago, they began to spread into other parts of the world. There they encountered new environments and new challenges. This Homo erectus skull from Dmanisi, Republic of Georgia, is one of the earliest skulls known outside of Africa.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200045'; 
