INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$While searching for fossils in Java, physician Eugne Dubois uncovered the tophalf of an early human skull in 1891. This skull, Trinil 2, is long, with a flat forehead and distinct browridges and a sagittal keel, though many of its features have been worn flat with age. Dubois named a new species, Pithecanthropus erectus after this specimen in 1894, but Ernst Mayr reassigned Trinil 2 to Homo erectus in the 1950s.    This skull is flat on the bottom because the plaster base (brown and white areas) added underneath the fossil bone for display purposes is included in this scan.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200058'; 
