INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$This composite skull combines several skulls from the same site, first named Sinanthropus pekingensis but later attributed to Homo erectus. The original fossils vanished while being shipped to the United States for safety during World War II, but scientists still have high-quality casts and descriptions to work with.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200059'; 
