INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$This adult female, who died around the age of 30, was only a little over 1 m (3.5 ft) tall. Her brain, estimated at 400 cubic centimeters, was as small as those of chimpanzees and the smallest australopithecines. She had fairly large brow ridges, and her teeth were large relative to the rest of the skull. Her fossils consist of an almost-complete skull and partial skeleton that include her legs, hands, feet, part of her pelvis, and other fragments. LB-1 is the most complete H. floresiensis fossil found to date.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200060'; 
