INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$This is the most complete "robust" australopithecine skull ever discovered and is considered to be a rare female of this species. DNH 7 was recovered from the DNH 7 or Eurydice Block in the Central Excavation Area of the site, which consists of material that has collapsed due to lime mining. However, excavation of the block has allowed its original position to be reconstructed, occurring below layers dated to 1.95 million years ago. The skull has been slightly distorted and the cranium lacks the left zygomatic arch (cheekbone), the superolateral margins of the left orbit (around the left eye socket), the nasal bones, the body of the sphenoid (an internal skull bone) and the anterior portion of the occipital (a bone at the back of the skull). The mandibular corpus (part of the jawbone) is well preserved.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200073'; 
