INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$Skhl V was recovered from the Skhl Cave near Mount Carmel, Israel, along with the skeletons of nine other adults and children. Some anatomical features, like the brow ridges above the eyes of the male Skhl V skull are reminiscent of earlier humans; however, Skhl V also has the high, vertical forehead and rounded skull typical of modern human skulls. At the back of the skull, Skhl V also lacks a projecting bun, which occurs in many Neanderthal skulls.  ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200077'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$The Skhl site was originally thought to be about 40,000 years old based on a comparison of animal remains and stone tools found at the site with those from other archeological sites in the region. This late date was important since it was then assumed that the Neanderthal fossils found at the nearby fossil site of Tabun Cave must be older than the modern Homo sapiens  population of Skhul. This assumption left open the possibility that the Tabun Neanderthals were the evolutionary ancestors of modern humans at Skhl.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200077'; 
INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$However, after more precise dating techniques, scientists found that the modern Homo sapiens fossils at Skhl were about 90,000 years old, much older than was previously thought. This meant the anatomically modern human population at Skhl lived at the same time as the Neanderthal population of Tabun. Therefore, the Tabun Neanderthals could not have been the ancestors of modern humans in the Near East.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200077'; 
