INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$European populations of this early human species were the ancestors of Neanderthals. African populations probably gave rise to our own species. Among the first species to inhabit Europes cold latitudes, Homo heidelbergensis hunted large animals and built simple shelters from wood and rocks. Notice this older males worn teeth and huge brow ridges.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200101'; 
