INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$What kind of animal do you think this charcoal figure represents? Some people believe the hind legs are human. This stone plaque is one of several carried into Apollo 11 Rock Shelter in Namibia where they were discovered in 1969 (when the first spacecraft - Apollo 11 - landed on the moon). Radiocarbon and other dating methods confirm that the cave layer that contained this plaque is between 60,000 and 40,000 years old.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200103'; 
