INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', 'Summary$PR$Smithsonian scientists and their Chinese colleagues found this and other handaxes in the same sediment layer with tektites, small rocks that formed during a meteor impact 803,000 years ago.  ', NULL, 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200105'; 
