INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$The Crab Nebula shows theremains of an exploded starlocated about 6,500 light yearsfrom Earth. The powerhouseengine energizing the Crabsystem is a pulsar, a rapidly spinningneutron star, shooting out pulsesof radiation 30 times a second.X-ray information from NASAsChandra X-ray Observatory wasused to create a three-dimensionalrepresentation of the Crab. TheX-ray structure shows the pulsarand a ringed disk of energizedmaterial, with jets of particles thatfire off from opposite ends of theenergetic pulsar. ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200117'; 
