INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$A nova is a star that suddenly becomes tensto hundreds of times brighter, then fades toits former brightness in just a few months.In these nova systems, a white dwarf  thecompact remains of a Sun-like star thathas burned all of its fuel  pulls materialfrom a nearby companion star until enoughaccumulates to trigger a thermonuclearexplosion on the white dwarfs surface.The model of such a nova outburstof an object called U Scorpii is basedon a scientific simulation, informed byobservations. It explores the first 18 hoursafter the last outburst observed on January28, 2010 in the system. Astronomers haveseen U Scorpii - which is about 40,000light years away from us - erupt about onceevery decade, so this system is due foranother outburst very soon. ', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200118'; 
