INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$On February 23, 1987, astronomers noticed a new source of light in the Large Magellanic Cloud (LMC), a small satellite galaxy of the Milky Way. Soon, scientists realized that this new beacon was, in fact, a spectacular explosion caused by the death of a massive star. It was a supernova, and became known as Supernova 1987A, or SN 1987A for short. The model depicts SN 1987A at its current observed age of 30 years, based on 3D simulations and constrained by X-ray observations from the Chandra X-ray Observatory. The blast wave from the supernova has crashed into a pre-existing ring of gas, throwing blobs of this gas upwards and downwards.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200119'; 
