INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$According to current theories, material falls onto a developing star, known as a "protostar," from a surrounding disk. The interaction between this rotating disk and the nascent star leads to the narrowing of material into jets that blast away from the magnetic poles of the would-be star. These stellar jets, detected in X-rays by Chandra, generate shock waves similar to those produced by supersonic jets.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200121'; 
