INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$Sky-watchers recorded a stellar explosion in the year 1572 AD, and its remnant is named for the 16th century astronomer Tycho Brahe, who famously described the supernova. Tychos Supernova Remnant (SNR) resulted from the explosion of a white dwarf star. The model shows how Tycho''s SNR might appear at an age of 1,000 years, after evolving from its current age of 447 years. While some supernovas generate neutron stars and black holes, Tychos SNR merely left an empty shell of material.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200122'; 
