INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$V745 Sco is a binary star system that consists of a red giant star and a white dwarf locked together by gravity. These two stellar objects orbit so closely around one another that the outer layers of the red giant are pulled away by the intense gravitational force of the white dwarf. This material gradually falls onto the surface of the white dwarf. Over time, enough material may accumulate on the white dwarf to trigger a colossal thermonuclear explosion, causing a dramatic brightening of the binary called a nova.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200123'; 
