INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Description$PR$Supernova remnant IC 443 shows the ejecta distribution approximately 8400 years after the supernova occurred. The toroidal purple structure represents a molecular cloud of the interstellar medium with which the blast wave of the remnant interacts. The small pink sphere marks the position of the pulsar wind nebula, detected in X-rays.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200124'; 
