INSERT INTO Metadata (Name, ValueShort, ValueExtended, idUser, idSystemObject) SELECT 'notes (ft)', NULL, 'Summary$PR$KNM-ER 1805 was found divided into three main parts: a cranium, a maxilla, and a mandible. The individual was an adult at the time of death, as evidenced by the third molars. Debate as to the correct classification of this fossil has existed ever since it was discovered. It was originally placed in Homo erectus, but based on the degree of prognathism and the shape of the cranium (especially the prominent nuchal crest), it is now considered to belong in H. habilis.', 1, idSystemObject FROM Identifier WHERE IdentifierValue = 'edanmdm:dpo_3d_200127'; 
